tility*100).toFixed(2)}%</div></div></div><div class="comparison-row"><span>Sharpe Ratio</span><div><div style="color:#FF6B6B">${currentPortfolio.sharpe.toFixed(4)}</div><div style="color:#52B788">${p.sharpe_ratio.toFixed(4)}</div></div></div></div><div class="comparison-section"><h3 style="color:#52B788;margin-bottom:15px">Net Changes</h3><div class="comparison-row"><span>Return</span><span class="${rDiff>=0?'improvement-positive':'improvement-negative'}">${rDiff>=0?'+':''}${(rDiff*100).toFixed(2)}% (${p.return_improvement>=0?'+':''}${p.return_improvement.toFixed(1)}%)</span></div><div class="comparison-row"><span>Volatility</span><span class="${vDiff<=0?'improvement-positive':'improvement-negative'}">${vDiff>=0?'+':''}${(vDiff*100).toFixed(2)}% (${p.volatility_change>=0?'+':''}${p.volatility_change.toFixed(1)}%)</span></div><div class="comparison-row"><span>Sharpe</span><span class="${sDiff>=0?'improvement-positive':'improvement-negative'}">${sDiff>=0?'+':''}${sDiff.toFixed(4)} (+${p.sharpe_improvement.toFixed(1)}%)</span></div></div><div class="comparison-section"><h3 style="color:#52B788;margin-bottom:12px">Execution Plan</h3><div style="background:#2a2a2a;padding:18px;border-radius:10px;border:1px solid #52B788"><div style="color:#52B788;font-weight:600;margin-bottom:12px;font-size:0.95em;text-transform:uppercase;letter-spacing:0.5px">Actions Required:</div><div style="color:#fff;line-height:2.2;font-size:0.95em">${p.trades.split(';').map((t,i)=>`<div style="padding:8px 0;border-bottom:1px solid #3a3a3a;display:flex;align-items:center"><span style="background:#52B788;color:#0a0a0a;padding:2px 8px;border-radius:4px;font-weight:600;margin-right:12px;font-size:0.85em">${i+1}</span><span>${t.trim()}</span></div>`).join('')}</div><div style="margin-top:18px;padding-top:18px;border-top:2px solid #3a3a3a;display:grid;grid-template-columns:1fr 1fr;gap:12px"><div><div style="color:#aaa;font-size:0.8em;margin-bottom:4px">BUDGET</div><div style="color:#52B788;font-weight:600;font-size:1.1em">10%</div></div><div><div style="color:#aaa;font-size:0.8em;margin-bottom:4px">TRANSACTIONS</div><div style="color:#52B788;font-weight:600;font-size:1.1em">${p.num_operations}</div></div></div></div></div>`;document.getElementById('comparisonPanel').classList.add('active')}function populateProposals(){const c=document.getElementById('proposals-content');if(!c.innerHTML){let h='';const opTitles={'1_operations':'1 Operation - Single Buy','2_operations':'2 Operations - Two Buys','3_operations':'3 Operations - Three Buys','4_operations':'4 Operations - Four Buys','5_operations':'5 Operations - Five Buys'};for(const[opKey,ports]of Object.entries(portfoliosData)){if(ports.length>0){h+=`<div class="category-section"><h2 class="category-title">${opTitles[opKey]}</h2><p style="color:#aaa;margin-bottom:20px">Top ${ports.length} portfolios by Sharpe • Budget: 10%</p><div class="portfolio-grid">`;ports.forEach((p,i)=>{const rank=p.rank||i+1;const rankBadge=rank<=3?`<span style="background:#52B788;color:#0a0a0a;padding:4px 10px;border-radius:6px;font-size:0.85em;font-weight:600;margin-left:10px">#${rank}</span>`:'';h+=`<div class="portfolio-card" onclick="selectPortfolio('${opKey}',${i})"><div style="display:flex;justify-content:space-between;align-items:center;margin-bottom:12px"><span style="font-size:1.05em;font-weight:500;color:#ddd">Portfolio ${rank}</span>${rankBadge}</div><div class="portfolio-metric"><span class="metric-label">Expected Return:</span><span class="metric-value">${(p.returns*100).toFixed(2)}%</span><span class="${p.return_improvement>=0?'improvement-positive':'improvement-negative'}"> (${p.return_improvement>=0?'+':''}${p.return_improvement.toFixed(2)}%)</span></div><div class="portfolio-metric"><span class="metric-label">Volatility:</span><span class="metric-value">${(p.volatility*100).toFixed(2)}%</span><span class="${p.volatility_change<0?'improvement-positive':'improvement-negative'}"> (${p.volatility_change>=0?'+':''}${p.volatility_change.toFixed(2)}%)</span></div><div class="portfolio-metric"><span class="metric-label">Sharpe Ratio:</span><span class="metric-value">${p.sharpe_ratio.toFixed(4)}</span><span class="improvement-positive"> (+${p.sharpe_improvement.toFixed(2)}%)</span></div><div style="margin-top:14px;padding-top:14px;border-top:1px solid #333"><div style="color:#52B788;font-size:0.85em;font-weight:500;margin-bottom:6px">Action Required:</div><div style="color:#ccc;font-size:0.88em;line-height:1.7">${p.trades}</div></div></div>`});h+=`</div></div>`}}c.innerHTML=h||'<p style="text-align:center;color:#aaa;padding:50px">No portfolio improvements found.</p>'}}function selectPortfolio(opKey,idx){const p=portfoliosData[opKey][idx];document.querySelectorAll('.portfolio-card').forEach(c=>c.classList.remove('selected'));event.currentTarget.classList.add('selected');showComparison(p)}function closeComparison(){document.getElementById('comparisonPanel').classList.remove('active');document.querySelectorAll('.portfolio-card').forEach(c=>c.classList.remove('selected'));document.querySelectorAll('#tableBody tr').forEach(r=>r.classList.remove('selected-row'))}function openModal(id){const m=document.getElementById('modal');const img=document.getElementById('modal-img');img.src=document.getElementById(id+'-img').src;m.classList.add('active')}function closeModal(){document.getElementById('modal').classList.remove('active')}document.addEventListener('keydown',e=>{if(e.key==='Escape'){closeModal();closeComparison()}});</script></body></html>
